app.directive("cuAlerts", ['cuLocalAlertsFactory', '$cookies', function(cuLocalAlertsFactory, $cookies){
  return {
    restrict : "A",
    link: function (scope, element, attrs) {
      scope.cookies = $cookies.getAll();

      scope.is_admin = 0;
      if (jQuery("body").hasClass("site-admin")) {
        scope.is_admin = 1;
      }

      cuLocalAlertsFactory.getFeed(scope.url).then(function(data) {
        for (var i in data) {
          var block_id = "alert-" + data[i].id + '-' + data[i].changed;
          
          if (scope.cookies[block_id] !== undefined) {
            data[i].hide = 1;
          }
          else {
            scope.notEmpty = 1;
          }
        }

        if (scope.notEmpty) {
          scope.localAlerts = data;
        }
      });

      scope.getIcon = function(val) {
        switch (val) {
          case '1':
            return '<i class="fa fa-info-circle" aria-hidden="true"></i>';
          case '10':
            return '<i class="fa fa-exclamation-triangle" aria-hidden="true"></i>';
          case '11':
            return '<i class="fa fa-wheelchair" aria-hidden="true"></i>';
        }
      };

      scope.closeAlert = function(alert) {
        var block_id = "alert-" + alert.id + '-' + alert.changed;
        $cookies.put(block_id, block_id, { path: '/' });

        var target = jQuery("#alert-" + alert.id);

        target.slideUp(200, function() {
          target.remove();
        });
      };
    },
    template:
      '<div id="local-alerts" ng-if="localAlerts">' +
        '<div class="container">' +
          '<div id="alert-{{ alert.id }}" class="js-hide local-alert cu-alert" ng-repeat="alert in localAlerts" ng-if="!alert.hide || is_admin" slide-down>' +
            '<div class="alert-inner">' +
              '<div ng-bind-html="::getIcon(alert.attr)"></div>' + 
              '<div class="content">' +
                '<span class="glyphicon glyphicon-remove-sign pull-right" tabindex="0" ng-if="::!is_admin" ng-click="closeAlert(alert)"></span>' +
                '<h2 ng-switch on="alert.featured || alert.content !== \'\' || \'null\'">' +
                  '<span ng-switch-when="null" ng-bind-html="alert.title"></span>' +
                  '<a ng-switch-default href="{{ alert.path }}" ng-bind-html="alert.title"></a>' +
                  '<span class="edit-link badge" ng-if="::is_admin"><a ng-href="/node/{{ alert.id }}/edit">edit</a></span>' +
                '</h2>' +
                '<div ng-bind-html="alert.summary"></div>' +
              '</div>' +
            '</div>' +
          '</div>' +
        '</div>' +
      '</div>'
  };
}]);

app.factory('cuLocalAlertsFactory', function($http) {
  return {
    getFeed: function(target) {
      return $http({
        url: drupalSettings.path.baseUrl + 'json/alerts/local?_format=json',
        method: "GET",
        params: {url: target},
        timeout: 5000,
        ignoreLoadingBar: true
      }).then(function(result) {
        return result.data;
      }, function(error) {
        return true;
      });
    }
  };
});


(function ($, drupalSettings) {
  "use strict";

  var cookies = $.cookie();

  var is_admin = 0;
  if ($("body").hasClass("site-admin")) {
    is_admin = 1;
  }
  
  function bindCloseAlert() {
    // Hide alert click event.
    $(".close-alert").off("click").on("click", function() {
      var alert = $(this).parents('.cu-alert');
      alert.slideUp(200, function() {
        alert.remove();
      });

      var block_id = alert.attr('id');
      // Set the alert cookie.
      $.cookie(block_id, block_id, { path: '/' });
    });        
  }

  if (drupalSettings.cu_alert && drupalSettings.cu_alert.master !== undefined) {

    var master = drupalSettings.cu_alert.master;
    
    if (master) {
      if (master != "none") {
        master = location.protocol + '//' + master + '/alerts/data';
        $.ajax({
          url: drupalSettings.path.baseUrl + "modules/custom/columbia/cu_utility_functions/json-wrapper.php",
          data: "url=" + master
        }).done(function(data) {
          if (data) {
          
            var alerts = '';

            var total_alerts = 0;
            total_alerts =  Object.keys(data).length;
            
            // Iterate over responses and build alert html.
            $.each(data, function(index, alert) {
              // Check if cookie has been set for the given alert. Cookie id is set based on the alert id
              // in the form {alert id}, eg: 'alert-20'.
              alert = '<div>' + alert + '</div>';
              
              var $alert;
              $alert = $(alert).find(".cu-alert");

              var alert_id;
              alert_id = $alert.attr('id');
              var block_id = alert_id;

              if (!is_admin) {
                if (cookies[block_id] === undefined) {
                  alerts += $alert.wrap('<div/>').parent().html();
                }
              }
              else {
                if (cookies[block_id] !== undefined) {
                  $alert = $alert.addClass("hidden");
                }

                alerts += $alert.wrap('<div/>').parent().html();
              }
              
            });
            if (alerts) {
              var markup = "";
              markup = '<div id="global-alerts"><div class="container">' + alerts + '</div></div>';
              $('#alerts').html(markup).slideDown(500);
            }

          }

          bindCloseAlert();
        }).fail(function() {
          bindCloseAlert();
        });
      }
    }
    else {
      bindCloseAlert();
    }

  }
})(jQuery, drupalSettings);
